exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper}=await require("transcode/parse_catalog"),url=`https://www.138txt.net/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,"div#list>dl>dd",{clientOptions:{...(options&&options.clientOptions)},preprocess:html=>html.replace(/<dl><\/dl>/g,"")})};